import { Component } from "react";
import Axios from "axios"
import {Link} from 'react-router-dom'
class UserList extends Component{
    constructor(props) {
        super(props);
        this.state = {
          userList: []
        };
    this.LoadUserList = this.LoadUserList.bind(this);
    }

     LoadUserList=(event)=>{
        if(event === undefined)
        Axios.get(window.$domain + 'api/Users').then(
            resp=>{
                this.setState({userList: resp.data});
                console.log(resp.data)
            }
        ).catch(
            err=>{
                alert('Page:manageuser =>'+err)
                console.log('Page:manageuser =>'+err)
            }
        )
        else {
            Axios.get(window.$domain + 'api/Users/SearchUserbyCNIC/' + event.target.value).
            then(
                resp=>{
                    this.setState({userList: resp.data});
                }
            ).catch(
                err=>{
                    alert('Page:manageuser =>'+err)
                    console.log('Page:manageuser =>'+err)
                }
            )
        }
    }
    componentDidMount(){
        if(this.state.userList.length === 0)
        this.LoadUserList();
    }

    render(){
        return(
            <div className="jumbotron container-fluid overflow-auto">
                <div class="form-group ">
                    <label>Search by CNIC Number:</label>
                    <input  type='text' class="form-control" onChange={this.LoadUserList}/>
                </div>

                <h3>User List</h3>
                <table className="table table-bordered">
                    <thead>
                        <tr >
                            <th>System Id</th>
                            <th>Name</th>
                            <th>Gender</th>
                            <th>User Name</th>
                            <th>Email</th>
                            <th>Phone Number</th>
                            <th>CNIC</th>
                            <th>Last Login</th>
                            <th>Registration Date</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.userList.length > 0 ?
                            this.state.userList.map(user=>{
                                return <tr key={user.id}>
                                    <td>{user.id}</td>
                                    <td>{user.name}</td>
                                    <td>{user.gender}</td>
                                    <td>{user.userName}</td>
                                    <td>{user.email}</td>
                                    <td>{user.phoneNumber}</td>
                                    <td>{user.cnic}</td>
                                    <td>{user.lastLogin}</td>
                                    <td>{user.registration_Date}</td>
                                    <td><Link to={'/ShowAccountDetails/'+ user.id} >Accounts</Link></td>
                                </tr>
                            }): <h5>Please Wait! we are Loading Your Data from Server</h5>
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default UserList;
